import { FiArrowLeft, FiLink, FiTrash } from 'react-icons/fi';
import './Links.css';

function Links() {
    return (
        <div className="links-container">
            <div className="links-header">
                <FiArrowLeft size={38} color="#fff" />
            </div>
        </div>
    );
}
